import React from 'react';

class Result extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (<div className='result'>
            <h1 className='title'>
                结果
            </h1>
            <table className='resultTable'>
                <tbody>
                    <tr>
                        <th colSpan={2}>基本信息</th>
                        <td></td>
                    </tr>
                </tbody>
                <colgroup>
                    <col id='acdemic'></col>
                    <col id='social'></col>
                    <col id='normal'></col>
                </colgroup>
            </table>
            <img src={require('./image/1.png')} />
        </div>);
    }
}

export default Result;
